import React from 'react';

function Equipo() {
  return (
    <div className="container mt-5">
      <h2>Nuestro Equipo</h2>
      <p>Conoce a las personas detrás del éxito de nuestra empresa.</p>
    </div>
  );
}

export default Equipo;
